import React from 'react';
import Menu from './Menu/Menu'

import '../css/App.css';

export default function Navegation(props){
    const loggin = props.loggin;
    if (loggin==='true'){
        return(
            <Menu nombre="Juan"/>
        )
    }
    return(
        <Menu nombre="nadie"/>
    )

}
